// 表单类
// ErhaiLake.affix类
(function () {
    var ErhaiLake = {};
    ErhaiLake.affix = function (name, event) {
        var ErhaiLakeAaffix = document.querySelectorAll('button[ErhaiLake-affix=' + name + "]");
        ErhaiLakeAaffix.forEach(function (element) {
            event(element)
        })
    };
    window.ErhaiLake = ErhaiLake;
})();

// 定义密码显隐
ErhaiLake.affix('eye', function (element) {
    var iconElement = document.createElement('i');
    iconElement.className = 'ErhaiLakeUI-icon bukejian';
    element.appendChild(iconElement);
    element.addEventListener('click', function () {
        var icon = iconElement.className;
        if (icon === 'ErhaiLakeUI-icon bukejian') {
            iconElement.className = 'ErhaiLakeUI-icon kejian';
            var parent = element.parentNode.parentNode;
            var inputElement = parent.querySelector('input[type="password"]');
            inputElement.type = 'text';
        } else {
            iconElement.className = 'ErhaiLakeUI-icon bukejian';
            var parent = element.parentNode.parentNode;
            var inputElement = parent.querySelector('input[type="text"]');
            inputElement.type = 'password';
        }
    });
})

// 定义内容清除
ErhaiLake.affix('clear', function (element) {
    var iconElement = document.createElement('i');
    iconElement.className = 'ErhaiLakeUI-icon shanchu';
    element.appendChild(iconElement);
    element.addEventListener('click', function () {
        var inputElement = element.closest('.ErhaiLakeUI-form-text-group').querySelector('input');
        inputElement.value = '';
    });
})